import axios from 'axios';
const Login=()=>{
    const [email,setEmail] = useState('');
    const [password,setPassword] = useState('');
    const doTheLogin= async() =>  {
      await axios.post(
        BaseUrl + "/categories/createwithoutMeals",
        {
          name: categorietoadd,
        },
        {
          headers: { restaurantid: "6218f6174af0250cad788d42" },
        }
      ).then((res) => {
        if (res.status == 201) {
          listCategories.push({ name: res.data["name"] });
          doCloseopenAddCategorie();
          setcategorietoadd("");
          setdataReady(false);
          setdataReady(true);
        }
        console.log(res);
      });
    }
    return <>
  <Wrapper>
        <Form >
            <Title>Welcome</Title>
          <Input
            type="email"
            name="email"
            onChange={e=>setEmail(e.target.value)}
            placeholder='email'
            value={email}
          />
          <Input
          onChange={e=>setPassword(e.target.value)}
            type="password"
            name="password"
            placeholder='password'
            value={password}
          />
          <Button  onClick={doTheLogin}>Login</Button>
        </Form>
      </Wrapper>
    </>
};  
export default Login;
